import React from 'react';

export default function ModalOrders(props) {

    const orders = props.customer.orders;
    console.log(orders.name)
    const ordersData = () => {
        return (
            <div>{orders.amount}</div>
        )
    }

    return (
        <div>
            <h5>Toutes les commandes</h5>
            {ordersData}
        </div>
    )
}
